import React from 'react';

class Button extends React.Component {
  handleClick = () => {
    // Handle button click logic here
    console.log('Button clicked!');
  }

  render() {
    return (
      <button onClick={this.handleClick}>
        {this.props.label}
      </button>
    );
  }
}

export default Button;
